%[text] # Detect Muscle Activity and Fatigue from EMG Using Time- and Frequency-Domain Analysis
%[text] This example demonstrates how to get an Electromyography (EMG) dataset and extract information from it, this includes some time-domain parameters and frequency-domain parameters.
%[text] The data used in this example can be acquired from a wearable device such as a BITalino board and should be provided in a supported file format described in the Data Description section. While this example does not include code for acquiring EMG data directly from [BITalino](https://www.pluxbiosignals.com/collections/bitalino?srsltid=AfmBOorALQY6SNKViG8JypRobeGXwezf108ouDzG5tW3Qt316vIDQaYb), you can refer to the [Getting Started with BITalino guide](https://www.mathworks.com/matlabcentral/fileexchange/136004-matlab-support-for-bitalino-biosignal-devices) for instructions on data acquisition and device setup.
%[text] This example does require an additional Add-On beyond MATLAB, this being the Signal Processing Toolbox and is intended to work with raw EMG data for straightforward analysis and visualization.
%%
%[text] ## Data Description
%[text] This example works with EMG recordings stored as plain text, CSV or data files containing one or more columns of sampled voltage values. The signal represents a single lead EMG waveform, such as those captured using wearable sensors like the BITalino board or similar acquisition systems.
%[text] It is also possible to use more complex data files using the *readtable* function to extract the column of interest. The sample data used in this example can be recorded by the user or obtained from publicly available datasets, as long as it is formatted accordingly.
%%
%[text] ## Download Data
%[text] The first step is to acquire an EMG recording to use as input for the analysis. As mentioned before, this example supports data collected from a BITalino device or publicly available EMG datasets such as those provided by [PhysioNet](https://physionet.org/).
%[text] This example uses a dataset from [Examples of Electromyograms](https://physionet.org/content/emgdb/1.0.0/).
%[text] The filename and sampling rate can be specified when running the example. If not specified, the sampling rate defaults to 4000 Hz since this is the sampling rate of the dataset used.
%[text] If you download data from PhysioNet, follow the sourceâ€™s guidelines for data citation and usage. Some datasets may include additional metadata or annotations; however, for this example, only the raw EMG signal is required. Because of that, to use those data *readtable* has to be used selecting the column of interest.
%%
%[text] ## Load File 
%[text] If chosen a sample from PhysioNet you can unzip and load it using the following commands.
if ~exist("examples-of-electromyograms-1.0.0/emg_healthy.txt", 'file') || ...
   ~exist("examples-of-electromyograms-1.0.0/emg_myopathy.txt", 'file') || ...
   ~exist("examples-of-electromyograms-1.0.0/emg_neuropathy.txt", 'file')
    url = 'https://physionet.org/content/emgdb/get-zip/1.0.0/';
    unzip(url);
end
load("examples-of-electromyograms-1.0.0\emg_healthy.txt")
load("examples-of-electromyograms-1.0.0\emg_myopathy.txt")
load("examples-of-electromyograms-1.0.0\emg_neuropathy.txt")
%[text] In this example we are going to use data from three patients, one healthy, one with a myopathy and one with a neuropathy. Each of these patients has two EMG recordings, one using a high-pass filter of 20 Hz and another using a low-pass filter of 5000 Hz.
% Defining the samples we are going to work with

% Healthy individual on a High pass filter
healthyHPF = emg_healthy(:, 1); 

% Healthy individual on a Low pass filter
healthyLPF = emg_healthy(:, 2); 

% An individual with a myopathy on a High-pass filter
myopathyHPF = emg_myopathy(:, 1); 

% An individual with a myopathy on a Low-pass filter
myopathyLPF = emg_myopathy(:, 2); 

% An individual with a neuropathy on a High-pass filter
neuropathyHPF = emg_neuropathy(:, 1); 

% An individual with a neuropathy on a Low-pass filter
neuropathyLPF = emg_neuropathy(:, 2); 
%%
%[text] ## Plotting the data from the dataset
% Maximum value of the High pass filter
maxHPF = max([max(healthyHPF), max(myopathyHPF), max(neuropathyHPF)]); 

titleFontSize = 16;
labelFontSize = 14;
legendFontSize = 12;

samplingRate = 50000;   % Sampling rate (Hz)

% Time
tHealthyHPF = (0:length(healthyHPF)-1) / samplingRate;
tMyopathyHPF = (0:length(myopathyHPF)-1) / samplingRate;
tNeuropathyHPF = (0:length(neuropathyHPF)-1) / samplingRate;
maxTimeHPF = max([tHealthyHPF(end), tMyopathyHPF(end), tNeuropathyHPF(end)]);

tHealthyLPF = (0:length(healthyLPF)-1) / samplingRate;
tMyopathyLPF = (0:length(myopathyLPF)-1) / samplingRate;
tNeuropathyLPF = (0:length(neuropathyLPF)-1) / samplingRate;


figure; %[output:35de0603]
% Healthy High-Pass Filter
subplot(3, 2, 1);  %[output:35de0603]
plot(tHealthyHPF,healthyHPF, 'b', 'LineWidth', 1.5);  %[output:35de0603]
title('Healthy - HPF','FontSize',titleFontSize);  %[output:35de0603]
xlim([0 maxTimeHPF]);  %[output:35de0603]
ylim([0 maxHPF]); %[output:35de0603]
xlabel('Time (s)', 'FontSize', labelFontSize); %[output:35de0603]
ylabel('Amplitude', 'FontSize', labelFontSize); %[output:35de0603]

% Healthy Low-Pass Filter
subplot(3, 2, 2); %[output:35de0603]
plot(tHealthyLPF, healthyLPF, 'b', 'LineWidth', 1.5); %[output:35de0603]
title('Healthy - LPF', 'FontSize', titleFontSize); %[output:35de0603]
xlabel('Time (s)', 'FontSize', labelFontSize); %[output:35de0603]
ylabel('Amplitude', 'FontSize', labelFontSize); %[output:35de0603]

% Myopathy High-Pass Filter
subplot(3, 2, 3);  %[output:35de0603]
plot(tMyopathyHPF,myopathyHPF, 'r', 'LineWidth', 1.5); %[output:35de0603]
title('Myopathy - HPF','FontSize',titleFontSize);  %[output:35de0603]
xlim([0 maxTimeHPF]);  %[output:35de0603]
ylim([0 maxHPF]); %[output:35de0603]
xlabel('Time (s)', 'FontSize', labelFontSize); %[output:35de0603]
ylabel('Amplitude', 'FontSize', labelFontSize); %[output:35de0603]

% Myopathy Low-Pass Filter
subplot(3, 2, 4); %[output:35de0603]
plot(tMyopathyLPF, myopathyLPF, 'r', 'LineWidth', 1.5); %[output:35de0603]
title('Myopathy - LPF', 'FontSize', titleFontSize); %[output:35de0603]
xlabel('Time (s)', 'FontSize', labelFontSize); %[output:35de0603]
ylabel('Amplitude', 'FontSize', labelFontSize); %[output:35de0603]

% Neuropathy High-Pass Filter
subplot(3, 2, 5);  %[output:35de0603]
plot(tNeuropathyHPF,neuropathyHPF, 'g', 'LineWidth', 1.5); %[output:35de0603]
title('Neuropathy - HPF','FontSize',titleFontSize);  %[output:35de0603]
xlim([0 maxTimeHPF]);  %[output:35de0603]
ylim([0 maxHPF]); %[output:35de0603]
xlabel('Time (s)', 'FontSize', labelFontSize); %[output:35de0603]
ylabel('Amplitude', 'FontSize', labelFontSize); %[output:35de0603]

% Neuropathy Low-Pass Filter
subplot(3, 2, 6); %[output:35de0603]
plot(tNeuropathyLPF, neuropathyLPF, 'g', 'LineWidth', 1.5); %[output:35de0603]
title('Neuropathy - LPF', 'FontSize', titleFontSize); %[output:35de0603]
xlabel('Time (s)','FontSize', labelFontSize); %[output:35de0603]
ylabel('Amplitude','FontSize', labelFontSize); %[output:35de0603]
%%
%[text] ## Time-Frequency Features 
%[text] In this section we will process the signal to get the time-frequency features, the Fast Fourier Transformation (FFT).
%[text] First for the samples that were subjected to a high pass filter and then for a low pass filter. 
% Samplingfrequency
samplingFrenquency = 50000; % In Hz

% Sample lenghts
sampleLengthHHPF = length(healthyHPF);
sampleLengthMHPF = length(healthyHPF);
sampleLengthNHPF = length(healthyHPF);

% FFT for Healthy HPF
vectorHealthyHPF = fft(healthyHPF);
% Two-sided spectrum
P2HHPF = abs(vectorHealthyHPF / sampleLengthHHPF);
 % One-sided spectrum
P1HHPF = P2HHPF(1:sampleLengthHHPF/2 + 1);         
P1HHPF(2:end-1) = 2 * P1HHPF(2:end-1);
frequencyHealthyHPF = samplingFrenquency * (0:(sampleLengthHHPF/2)) / sampleLengthHHPF;  

% FFT for Myopathy HPF
vectorMyopathyHPF = fft(myopathyHPF);
% Two-sided spectrum
P2MHPF = abs(vectorMyopathyHPF / sampleLengthMHPF);     
% One-sided spectrum
P1MHPF = P2MHPF(1 : sampleLengthMHPF/2 + 1);          
P1MHPF(2:end-1) = 2 * P1MHPF(2:end-1);
frequencyMyopathyHPF = samplingFrenquency * (0:(sampleLengthMHPF/2)) / sampleLengthMHPF;

% FFT for Neuropathy HPF
vectorNeuropathyHPF = fft(neuropathyHPF);
% Two-sided spectrum
P2NHPF = abs(vectorNeuropathyHPF / sampleLengthNHPF);     
% One-sided spectrum
P1NHPF = P2NHPF(1:sampleLengthNHPF/2 + 1);          
P1NHPF(2:end-1) = 2 * P1NHPF(2:end-1);
frequencyNeuropathyHPF = samplingFrenquency * (0:(sampleLengthNHPF/2)) / sampleLengthNHPF; 

% Plotting the results
figure; %[output:53f3f469]
hold on; grid on; %[output:53f3f469]

plot(frequencyHealthyHPF, P1HHPF, 'g', 'LineWidth', 1.2);  %[output:53f3f469]
plot(frequencyMyopathyHPF, P1MHPF, 'b', 'LineWidth', 1.2);  %[output:53f3f469]
plot(frequencyNeuropathyHPF, P1NHPF, 'r', 'LineWidth', 1.2);  %[output:53f3f469]

title('FFT of HPF EMG Signals', 'FontSize', titleFontSize); %[output:53f3f469]
xlabel('Frequency (Hz)', 'FontSize', labelFontSize); %[output:53f3f469]
ylabel('|Amplitude|', 'FontSize', labelFontSize); %[output:53f3f469]
legend('Healthy HPF', 'Myopathy HPF', 'Neuropathy HPF', 'FontSize', legendFontSize); %[output:53f3f469]
set(gca, 'FontSize', labelFontSize); %[output:53f3f469]
xlim([0 2000]); %[output:53f3f469]
ylim([0 4]);  %[output:53f3f469]
hold off; %[output:53f3f469]
%%
%[text] ## Time-Domain Features 
%[text] In this section we process the signal to extract the time-domain features such as root mean square and mean absolute value.
%[text] First for the samples that were subjected to a high-pass filter and then for a low-pass filter. 
% Root Mean Square - RMS (HPF)
rmsHealthyHPF = rms(healthyHPF);
rmsMyopathyHPF = rms(myopathyHPF);
rmsNeuropathyHPF = rms(neuropathyHPF);

% Mean Absolute Value - MAV (HPF)
mavHealthyHPF = mean(abs(healthyHPF));
mavMyopathyHPF = mean(abs(myopathyHPF));
mavNeuropathyHPF = mean(abs(neuropathyHPF));

% Zero Crossing Count - ZC (HPF)
zcHealthyHPF = sum(diff(sign(healthyHPF)) ~=0);
zcMyopathyHPF = sum(diff(sign(myopathyHPF)) ~=0);
zcNeuropathyHPF = sum(diff(sign(neuropathyHPF)) ~=0);

% Integrated EMG (HPF)
iEMGHEalthyHPF = sum(abs(healthyHPF));
iEMGMyopathyHPF = sum(abs(myopathyHPF));
iEMGNeuropathyHPF = sum(abs(neuropathyHPF));

rmsValues = [rmsHealthyHPF, rmsMyopathyHPF, rmsNeuropathyHPF];

% RMS plot for HPF
figure; %[output:9de6ce4e]
rmsGraph = bar(rmsValues); %[output:9de6ce4e]
rmsGraph.FaceColor = 'flat'; %[output:9de6ce4e]
rmsGraph.CData =  [0 1 0; 0 0 1; 1 0 0]; %[output:9de6ce4e]
set(gca, 'XTickLabel', {'Healthy','Myopathy','Neuropathy'}, 'FontSize', labelFontSize); %[output:9de6ce4e]
ylabel('RMS Value', 'FontSize', labelFontSize); %[output:9de6ce4e]
title('RMS of High Pass Filtered', 'FontSize', titleFontSize); %[output:9de6ce4e]
mavValues = [mavHealthyHPF, mavMyopathyHPF, mavNeuropathyHPF];

% Results of the MAV values
figure; %[output:3be01759]
mavGraph = bar(mavValues); %[output:3be01759]
mavGraph.FaceColor = 'flat'; %[output:3be01759]
mavGraph.CData =  [0 1 0; 0 0 1; 1 0 0]; %[output:3be01759]
set(gca, 'XTickLabel', {'Healthy','Myopathy','Neuropathy'}, 'FontSize', labelFontSize); %[output:3be01759]
ylabel('MAV Value', 'FontSize', labelFontSize); %[output:3be01759]
title('MAV of High Pass Filtered', 'FontSize', titleFontSize); %[output:3be01759]

% Root Mean Square - RMS (LPF)
rmsHealthyLPF = rms(healthyLPF);
rmsMyopathyLPF = rms(myopathyLPF);
rmsNeuropathyLPF = rms(neuropathyLPF);

% Mean Absolute Value - MAV (LPF)
mavHealthyLPF = mean(abs(healthyLPF));
mavMyopathyLPF = mean(abs(myopathyLPF));
mavNeuropathyLPF = mean(abs(neuropathyLPF));

% Zero Crossing Count - ZC (LPF)
zcHealthyLPF = sum(diff(sign(healthyLPF)) ~=0);
zcMyopathyLPF = sum(diff(sign(myopathyLPF)) ~=0);
zcNeuropathyLPF = sum(diff(sign(neuropathyLPF)) ~=0);

% Integrated EMG (LPF)
iEMGHealthyLPF = sum(abs(healthyLPF));
iEMGMyopathyLPF = sum(abs(myopathyLPF));
iEMGNeuropathyLPF = sum(abs(neuropathyLPF));

% RMS plot for LPF
rmsValuesLPF = [rmsHealthyLPF, rmsMyopathyLPF, rmsNeuropathyLPF];
figure; %[output:15129dc8]
rmsGraphLPF = bar(rmsValuesLPF); %[output:15129dc8]
rmsGraphLPF.FaceColor = 'flat'; %[output:15129dc8]
rmsGraphLPF.CData =  [0 1 0; 0 0 1; 1 0 0]; %[output:15129dc8]
set(gca, 'XTickLabel', {'Healthy','Myopathy','Neuropathy'}, 'FontSize', labelFontSize); %[output:15129dc8]
ylabel('RMS Value', 'FontSize', labelFontSize); %[output:15129dc8]
title('RMS of Low Pass Filtered', 'FontSize', titleFontSize); %[output:15129dc8]
% MAV plot for LPF
mavValuesLPF = [mavHealthyLPF, mavMyopathyLPF, mavNeuropathyLPF];
figure; %[output:60b11d95]
mavGraphLPF = bar(mavValuesLPF); %[output:60b11d95]
mavGraphLPF.FaceColor = 'flat'; %[output:60b11d95]
mavGraphLPF.CData =  [0 1 0; 0 0 1; 1 0 0]; %[output:60b11d95]
set(gca, 'XTickLabel', {'Healthy','Myopathy','Neuropathy'}, 'FontSize', labelFontSize); %[output:60b11d95]
ylabel('MAV Value', 'FontSize', labelFontSize); %[output:60b11d95]
title('MAV of Low Pass Filtered', 'FontSize', titleFontSize); %[output:60b11d95]
% ZC plot for LPF
zcValuesLPF = [zcHealthyLPF, zcMyopathyLPF, zcNeuropathyLPF];
figure; %[output:8a4da599]
zcGraph = bar(zcValuesLPF); %[output:8a4da599]
zcGraph.FaceColor = 'flat'; %[output:8a4da599]
zcGraph.CData =  [0 1 0; 0 0 1; 1 0 0]; %[output:8a4da599]
set(gca, 'XTickLabel', {'Healthy','Myopathy','Neuropathy'}, 'FontSize', labelFontSize); %[output:8a4da599]
ylabel('Zero Crossing Count', 'FontSize', labelFontSize); %[output:8a4da599]
title('Zero Crossing Count of Low Pass', 'FontSize', titleFontSize); %[output:8a4da599]
%%
%[text] ## Frequency-Domain Features
%[text] 
% Calculate Power Spectral Density (PSD) using Welch's method
[powerspectraldensityHealthyHPF, frequencyHealthyHPF] = pwelch(healthyHPF, hamming(2048), 1024, 2048, samplingRate);
[powerspectraldensityMyopathyHPF, frequencyMyopathyHPF] = pwelch(myopathyHPF, hamming(2048), 1024, 2048, samplingRate);
[powerspectraldensityNeuropathyHPF, frequencyNeuropathyHPF] = pwelch(neuropathyHPF, hamming(2048), 1024, 2048, samplingRate);
[powerspectraldensityHealthyLPF, frequencyHealthyLPF] = pwelch(healthyLPF, hamming(2048), 1024, 2048, samplingRate);
[powerspectraldensityMyopathyLPF, frequencyMyopathyLPF] = pwelch(myopathyLPF, hamming(2048), 1024, 2048, samplingRate);
[powerspectraldensityNeuropathyLPF, frequencyNeuropathyLPF] = pwelch(neuropathyLPF, hamming(2048), 1024, 2048, samplingRate);

% Mean Frequency (MNF)
healthyHPFMNF = sum(frequencyHealthyHPF .* powerspectraldensityHealthyHPF) / sum(powerspectraldensityHealthyHPF);
myopathyHPFMNF = sum(frequencyMyopathyHPF .* powerspectraldensityMyopathyHPF) / sum(powerspectraldensityMyopathyHPF);
neuropathyHPFMNF = sum(frequencyNeuropathyHPF .* powerspectraldensityNeuropathyHPF) / sum(powerspectraldensityNeuropathyHPF);
healthyLPFMNF = sum(frequencyHealthyLPF .* powerspectraldensityHealthyLPF) / sum(powerspectraldensityHealthyLPF);
myopathyLPFMNF = sum(frequencyMyopathyLPF .* powerspectraldensityMyopathyLPF) / sum(powerspectraldensityMyopathyLPF);
neuropathyLPFMNF = sum(frequencyNeuropathyLPF .* powerspectraldensityNeuropathyLPF) / sum(powerspectraldensityNeuropathyLPF);

% Median Frequency (MDF)
cdfHealthyHPF = cumsum(powerspectraldensityHealthyHPF) / sum(powerspectraldensityHealthyHPF);
MDFHealthyHPF = frequencyHealthyHPF(find(cdfHealthyHPF >= 0.5, 1));
cdfMyopathyHPF = cumsum(powerspectraldensityMyopathyHPF) / sum(powerspectraldensityMyopathyHPF);
MDFMyopathyHPF = frequencyMyopathyHPF(find(cdfMyopathyHPF >= 0.5, 1));
cdfNeuropathyHPF = cumsum(powerspectraldensityNeuropathyHPF) / sum(powerspectraldensityNeuropathyHPF);
MDFNeuropathyHPF = frequencyNeuropathyHPF(find(cdfNeuropathyHPF >= 0.5, 1));
cdfHealthyLPF = cumsum(powerspectraldensityHealthyLPF) / sum(powerspectraldensityHealthyLPF);
MDFHealthyLPF = frequencyHealthyLPF(find(cdfHealthyLPF >= 0.5, 1));
cdfMyopathyLPF = cumsum(powerspectraldensityMyopathyLPF) / sum(powerspectraldensityMyopathyLPF);
MDFMyopathyLPF = frequencyMyopathyLPF(find(cdfMyopathyLPF >= 0.5, 1));
cdfNeuropathyLPF = cumsum(powerspectraldensityNeuropathyLPF) / sum(powerspectraldensityNeuropathyLPF);
MDFNeuropathyLPF = frequencyNeuropathyLPF(find(cdfNeuropathyLPF >= 0.5, 1));

% Peak Frequency
[~, idxHealthyHPF] = max(powerspectraldensityHealthyHPF);
PFHealthyHPF = frequencyHealthyHPF(idxHealthyHPF);

[~, idxMyopathyHPF] = max(powerspectraldensityMyopathyHPF);
PFMyopathyHPF = frequencyMyopathyHPF(idxMyopathyHPF);

[~, idxNeuropathyHPF] = max(powerspectraldensityNeuropathyHPF);
PFNeuropathyHPF = frequencyNeuropathyHPF(idxNeuropathyHPF);

[~, idxHealthyLPF] = max(powerspectraldensityHealthyLPF);
PFHealthyLPF = frequencyHealthyLPF(idxHealthyLPF);

[~, idxMyopathyLPF] = max(powerspectraldensityMyopathyLPF);
PFMyopathyLPF = frequencyMyopathyLPF(idxMyopathyLPF);

[~, idxNeuropathyLPF] = max(powerspectraldensityNeuropathyLPF);
PFNeuropathyLPF = frequencyNeuropathyLPF(idxNeuropathyLPF);

figure; %[output:306ad9a8]

% Healthy HPF
subplot(2, 3, 1); %[output:306ad9a8]
plot(frequencyHealthyHPF, 10*log10(powerspectraldensityHealthyHPF), 'k', 'LineWidth', 1.5); hold on; %[output:306ad9a8]
xline(healthyHPFMNF, '--r', sprintf('MNF %.1f Hz', healthyHPFMNF), 'LineWidth', 1); %[output:306ad9a8]
xline(MDFHealthyHPF, '--m', sprintf('MDF %.1f Hz', MDFHealthyHPF), 'LineWidth', 1); %[output:306ad9a8]
xline(PFHealthyHPF, '--b', sprintf('PF %.1f Hz', PFHealthyHPF), 'LineWidth', 1); %[output:306ad9a8]
xlim([0 1000]); %[output:306ad9a8]
xlabel('Frequency (Hz)'); ylabel('Power/Frequency (dB/Hz)'); %[output:306ad9a8]
title('Healthy HPF'); grid on; %[output:306ad9a8]

% Myopathy HPF
subplot(2, 3, 2); %[output:306ad9a8]
plot(frequencyMyopathyHPF, 10*log10(powerspectraldensityMyopathyHPF), 'k', 'LineWidth', 1.5); hold on; %[output:306ad9a8]
xline(myopathyHPFMNF, '--r', sprintf('MNF %.1f Hz', myopathyHPFMNF),'LineWidth', 1); %[output:306ad9a8]
xline(MDFMyopathyHPF, '--m', sprintf('MDF %.1f Hz', MDFMyopathyHPF),'LineWidth', 1); %[output:306ad9a8]
xline(PFMyopathyHPF, '--b', sprintf('PF %.1f Hz', PFMyopathyHPF),'LineWidth', 1); %[output:306ad9a8]
xlim([0 1000]); %[output:306ad9a8]
xlabel('Frequency (Hz)'); ylabel('Power/Frequency (dB/Hz)'); %[output:306ad9a8]
title('Myopathy HPF'); grid on; %[output:306ad9a8]

% Neuropathy HPF
subplot(2, 3, 3); %[output:306ad9a8]
plot(frequencyNeuropathyHPF, 10*log10(powerspectraldensityNeuropathyHPF), 'k', 'LineWidth', 1.5); hold on; %[output:306ad9a8]
xline(neuropathyHPFMNF, '--r', sprintf('MNF %.1f Hz', neuropathyHPFMNF), 'LineWidth', 1); %[output:306ad9a8]
xline(MDFNeuropathyHPF, '--m', sprintf('MDF %.1f Hz', MDFNeuropathyHPF), 'LineWidth', 1); %[output:306ad9a8]
xline(PFNeuropathyHPF, '--b', sprintf('PF %.1f Hz', PFNeuropathyHPF), 'LineWidth', 1); %[output:306ad9a8]
xlim([0 1000]); %[output:306ad9a8]
xlabel('Frequency (Hz)'); ylabel('Power/Frequency (dB/Hz)'); %[output:306ad9a8]
title('Neuropathy HPF'); grid on; %[output:306ad9a8]

% Healthy LPF
subplot(2, 3, 4); %[output:306ad9a8]
plot(frequencyHealthyLPF, 10*log10(powerspectraldensityHealthyLPF), 'k', 'LineWidth', 1.5); hold on; %[output:306ad9a8]
xline(healthyLPFMNF, '--r', sprintf('MNF %.1f Hz', healthyLPFMNF), 'LineWidth', 1); %[output:306ad9a8]
xline(MDFHealthyLPF, '--m', sprintf('MDF %.1f Hz', MDFHealthyLPF), 'LineWidth', 1); %[output:306ad9a8]
xline(PFHealthyLPF, '--b', sprintf('PF %.1f Hz', PFHealthyLPF), 'LineWidth', 1); %[output:306ad9a8]
xlim([0 1000]); %[output:306ad9a8]
xlabel('Frequency (Hz)'); ylabel('Power/Frequency (dB/Hz)'); %[output:306ad9a8]
title('Healthy LPF'); grid on; %[output:306ad9a8]

% Myopathy LPF
subplot(2, 3, 5); %[output:306ad9a8]
plot(frequencyMyopathyLPF, 10*log10(powerspectraldensityMyopathyLPF), 'k', 'LineWidth', 1.5); hold on; %[output:306ad9a8]
xline(myopathyLPFMNF, '--r', sprintf('MNF %.1f Hz', myopathyLPFMNF), 'LineWidth', 1); %[output:306ad9a8]
xline(MDFMyopathyLPF, '--m', sprintf('MDF %.1f Hz', MDFMyopathyLPF), 'LineWidth', 1); %[output:306ad9a8]
xline(PFMyopathyLPF, '--b', sprintf('PF %.1f Hz', PFMyopathyLPF), 'LineWidth', 1); %[output:306ad9a8]
xlim([0 1000]); %[output:306ad9a8]
xlabel('Frequency (Hz)'); ylabel('Power/Frequency (dB/Hz)'); %[output:306ad9a8]
title('Myopathy LPF'); grid on; %[output:306ad9a8]

% Neuropathy LPF
subplot(2, 3, 6); %[output:306ad9a8]
plot(frequencyNeuropathyLPF, 10*log10(powerspectraldensityNeuropathyLPF), 'k', 'LineWidth', 1.5); hold on; %[output:306ad9a8]
xline(neuropathyLPFMNF, '--r', sprintf('MNF %.1f Hz',neuropathyLPFMNF), 'LineWidth', 1); %[output:306ad9a8]
xline(MDFNeuropathyLPF, '--m', sprintf('MDF %.1f Hz',MDFNeuropathyLPF), 'LineWidth', 1); %[output:306ad9a8]
xline(PFNeuropathyLPF, '--b', sprintf('PF %.1f Hz',PFNeuropathyLPF), 'LineWidth', 1); %[output:306ad9a8]
xlim([0 1000]); %[output:306ad9a8]
xlabel('Frequency (Hz)'); ylabel('Power/Frequency (dB/Hz)'); %[output:306ad9a8]
title('Neuropathy LPF'); grid on; %[output:306ad9a8]

sgtitle('Power Spectral Density Analysis'); %[output:306ad9a8]

%[appendix]{"version":"1.0"}
